import { createStackNavigator } from 'react-navigation-stack';
import Home from '../screens/HomeScreen';
import Temperature from '../screens/Temperature';
import Light from '../screens/Light';
import AirQuality from '../screens/AirQuality';
import Header from '../shared/header';
import React from 'react';

const screens = {     // prerobiť na Odhlásiť
  Home: {
    screen: Home,
    navigationOptions: {
      header: null,
    },
  },
  Home: {
    screen: Home,
    navigationOptions: ({ navigation }) => {
      return {
        headerTitle: () => <Header navigation={navigation} title='VESNA Greenhouse' />,
      }
    }  
  },
  Temperature: {
    screen: Temperature,
    navigationOptions: ({ navigation }) => {
      return {
        headerTitle: () => <Header navigation={navigation} title='Temperature sensor' />,
      }
    }    
  },
  Light: {
    screen: Light,
    navigationOptions: ({ navigation }) => {
      return {
        headerTitle: () => <Header navigation={navigation} title='Light sensor' />,
      }
    }    
  },
  AirQuality: {
    screen: AirQuality,
    navigationOptions: ({ navigation }) => {
      return {
        headerTitle: () => <Header navigation={navigation} title='Air Quality sensor' />,
      }
    }    
  },
}
const HomeStack = createStackNavigator(screens, {
  defaultNavigationOptions: {
    headerTintColor: '#ffffff',
    headerStyle: {backgroundColor: '#e60073', height: 60 }
  }
});

export default HomeStack;
